// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract Faucet {
    address public owner;
    address public tokenAddress;
    uint public amountMax;

    modifier onlyOwner {
        require(msg.sender == owner, "Not the owner");
        _;
    }

    constructor(address _tokenAddress, uint _amountMax) {
        owner = msg.sender;
        tokenAddress = _tokenAddress;
        amountMax = _amountMax;
    }

    function changeTokenAddress(address _tokenAddress) onlyOwner public {
        tokenAddress = _tokenAddress;
    }

    function changeAmountMax(uint _amountMax) onlyOwner public {
        amountMax = _amountMax;
    }

    function amountOnWallet() public view returns(uint) {
        return IERC20(tokenAddress).balanceOf(msg.sender);
    }

    function amountOnFaucet() public view returns(uint) {
        return IERC20(tokenAddress).balanceOf(address(this));
    }

    function withdrawSome(uint256 _amount) public {
        require(
            (IERC20(tokenAddress).balanceOf(msg.sender)+_amount <= amountMax) || (msg.sender == owner),
            "Vous ne pouvez pas en posseder plus de 1000"
        );
        IERC20(tokenAddress).transfer(msg.sender, _amount * 10**18);
    }

    function withdrawAll() onlyOwner public {
        IERC20(tokenAddress).transfer(msg.sender, IERC20(tokenAddress).balanceOf(address(this)));
    }
    
    function deposit(uint _amount) public {
        IERC20(tokenAddress).transferFrom(msg.sender,address(this),_amount * 10**18);
    }
}
